script: |
  super -f text -I q10276.spq | sort > q10276.out

inputs:
  - name: q10276.spq
    data: |
      SELECT ALL col0 AS col0, col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE col1 NOT IN ( + + col1 * - - 10 * - + 26 );
  - name: tab2

outputs:
  - name: q10276.out
    data: |
      46	46
      64	64
      75	75
